import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <ul className="nav-links">
        <Link to="/login">
          <li>Login</li>{" "}
        </Link>

        <Link to="/">
          <li>Home</li>
        </Link>

        <Link to="/profile">
          <li>Profile</li>
        </Link>
      </ul>
    </div>
  );
}

export default Navbar;
